const [modName, silent, BASE64] = ['CedarInit', false, 'base64'];
const getUrl = dom => dom.querySelector('a')?.href;
const basename = name => name.replace(/^.*\/([^\/]*)$/, '$1');
const defFetchOpt = { redirect: 'follow', follow: 5, timeout: 1000 * 10 };
const fetchService = 'https://fetcher.i-cdf.workers.dev/?token=04b2bfba4b4c8dd0bcc7219e09d006ed&url=';
const logError = error => log(`⚠️ ERROR: ${error.message}`);
const get = async key => (await chrome.storage.local.get(key))?.[key] || '';

const catchTitles = new Set([
    'Your document checklist - Immigration, Refugees and Citizenship Canada',
]);

const tableIds = [
    'eapp-app-checklist-application-forms',
    'eapp-app-checklist-supporting-documents',
];

const mainDom = '<div id="CedarInit">'
    + '    <div>'
    + '        <span id="title"><img alt="Decision Made" src="data:image/png;base64, "></span>'
    + '        <button id="download" class="button" disabled="">Download</button>'
    + '        <pre id="logs" class="fields"></pre>'
    + '    </div>'
    + '</div>';

let line = 0;

const log = (content, skipConsole) => {
    if (silent) { return; }
    skipConsole || console.log(`[${modName.toUpperCase()}] ${content}`);
    const logs = document.querySelector('#logs');
    logs.textContent += `${++line}| ${content}\n`;
    logs.scrollTop = logs.scrollHeight;
};

const cleanText = (dom) => {
    return dom.innerText.replace(
        / *\(Opens a new window\)/, ''
    ).split('\n').map(x => {
        return x.trim();
    }).filter(x => { return x; }).join(' ');
};

const cleanName = (string, target) => {
    target.map(tar => {
        const [t, r] = Array.isArray(tar) ? tar : [tar, ''];
        string = string.replace(t, r);
    });
    return string;
};

const fileRead = async (file, verify) => {
    const b = (await get(file)) || null;
    return b && !verify ? new Uint8Array(Buffer.from(b, BASE64)).buffer : b;
};

const getPackage = (packages, type) => {
    for (let i in packages) { if (!packages[i][type]) { return packages[i]; } }
    packages.push({});
    return packages[packages.length - 1];
};

const parser = async (rootDom = document) => {
    log('Analyzing document requirement...');
    const tableDom = [];
    tableIds.map(id => {
        tableDom.push(...rootDom.querySelectorAll(`table#${id}`));
    });
    const people = {};
    let count = 0;
    for (let item of tableDom) {
        const caption = item.querySelector('caption');
        const [type, name, trs, documents] = [
            caption.childNodes[0].textContent.trim(),
            caption.childNodes[2].textContent.trim(),
            item.querySelectorAll('tbody tr'), [],
        ];
        for (let tr of trs) {
            const tds = tr.querySelectorAll('td');
            const name = cleanText(tds[1]);
            const doc = {
                name: name.replace(/ *\(required\)$/, ''),
                url: getUrl(tds[1]),
                required: name.includes('(required)'),
                // instructions: cleanText(tds[2]),
            };
            documents.push(doc);
        }
        people[name] = people[name] || [];
        getPackage(people[name], type)[type] = documents;
        count += documents.length;
    }
    let [names, output, intPkg] = [Object.keys(people), [], 0];
    names.map(n => {
        people[n].map((pack) => {
            const i = intPkg++;
            Object.keys(pack).map(type => {
                pack[type].map(d => {
                    output.push({ people: n, pkg: i, type, ...d, url: !!d.url });
                });
            });
        });
    });
    console.table(output)
    output.map(p => log(JSON.stringify(p), true));
    log(`Got ${names.length} people, ${intPkg} packages, ${count} documents.`);
    return { packages: people, output };
};

const build = async ({ packages: docList, output }) => {
    const root = await window.showDirectoryPicker();
    const [curItems, jobs] = [[], []];
    for await (const entry of root.values()) {
        if (entry.name.startsWith('.')) { continue; }
        curItems.push(entry);
    }
    assert(!curItems.length, new Error('Folder is not empty.'));
    let pi = 0;
    log('');
    log('Building document tree...');
    for (let i in docList) {
        for (let p in docList[i]) {
            const strPlog = `${utilitas.utilitas.ensureInt(++pi, { pad: 2 })} - ${i}`;
            const dirHandle = await root.getDirectoryHandle(strPlog, { create: true });
            let di = 0;
            for (let j in docList[i][p]) {
                for (let item of docList[i][p][j]) {
                    di++;
                    const strDi = utilitas.utilitas.ensureInt(di, { pad: 2 });
                    item.name = cleanName(item.name, [[/[\/\\]+/ig, ' '], /[^\ a-z0-9]*/ig]);
                    jobs.push((async () => {
                        const msgPad = `Applicant ${strPlog}, PKG ${p} => `;
                        if (item.url) {
                            const subname = cleanName(basename(item.url), ['_1']);
                            const filename = `${strDi}. ${i} - ${subname}`;
                            const fileHandle = await dirHandle.getFileHandle(filename, { create: true });
                            const writable = await fileHandle.createWritable();
                            let alternative;
                            if (/IMM5476/ig.test(item.url)) {
                                alternative = await fileRead('IMM5476.pdf');
                            }
                            if (alternative) {
                                await writable.write(alternative);
                                await writable.close();
                                log(`${msgPad}Fulfill via alternative: ${item.url}`);
                            } else {
                                let fRes = await fetch(`${fetchService}${encodeURIComponent(item.url)}`, defFetchOpt);
                                let href = '';
                                if (fRes.headers.get('content-type').includes('text/html')) {
                                    const subHtml = await fRes.text();
                                    const fileDom = new DOMParser().parseFromString(subHtml, 'text/html');
                                    const hrefDom = fileDom.querySelector('a[href*="pdf"]');
                                    if (hrefDom) {
                                        href = hrefDom.getAttribute('href');
                                        if (href.startsWith('/')) {
                                            href = `https://www.canada.ca${href}`;
                                        }
                                        fRes = await fetch(`${fetchService}${encodeURIComponent(href)}`, defFetchOpt);
                                    } else {
                                        log(`${msgPad}Error: No PDF link found.`);
                                    }
                                }
                                await fRes.body.pipeTo(writable);
                                log(`${msgPad}Fetch file: ${item.url}${href ? ` => ${href}` : ''}`);
                            }
                        } else {
                            const short = i.split(' ').map(x => x[0]).join('');
                            await dirHandle.getDirectoryHandle(`${strDi}. ${short} - ${item.name}`, { create: true });
                            log(`${msgPad}Create folder: ${item.name}`);
                        }
                    })());
                }
            }
        }
    }
    (await get('folders')).split('\n').map(x => x.trim()).filter(x => x).map(x => {
        jobs.push((async () => {
            await root.getDirectoryHandle(x, { create: true });
            log(`Create folder: ${x}`);
        })());
    });
    await Promise.all(jobs);
    log('');
    log('Done!');
};

if (catchTitles.has(document.title)) {
    setTimeout(async () => {
        $('body').append(mainDom);
        $('#CedarInit').show();
        $('#CedarInit').dblclick(async (event) => {
            const b = $('#CedarInit')?.css('bottom');
            $('#CedarInit').animate({ bottom: b === '10px' ? '-640px' : '10px' }, 500);
        });
        const result = await (async () => {
            try { return await parser(); } catch (e) { logError(e); }
        })();
        if (Object.keys(result).length) {
            $('#download').click(async () => {
                $('#CedarInit').animate({
                    bottom: '10px'
                }, 500, async () => {
                    try { await build(result); } catch (e) { logError(e); }
                });
            });
            $('#download').removeAttr('disabled');
        }
    }, 500);
}
